import React from 'react'
import Pagination from "react-bootstrap/Pagination"

const PaginationComponenet = ({ tot }) => {
    return (
        <Pagination>
            <Pagination.Prev />
            <Pagination.Item>1</Pagination.Item>
            <Pagination.Item>1</Pagination.Item>
            <Pagination.Next />
        </Pagination>
    )
}

export default PaginationComponenet;
